INSERT INTO `tbl_questions` (`question_id`, `subtopic_id_fk`, `question_difficulty`, `question_type`, `question_name`, `mcq_a`, `mcq_b`, `mcq_c`, `mcq_d`, `question_answer`, `score`, `hints`, `boss_level_id_fk`, `updated_at`, `updated_by`, `created_at`, `created_by`) VALUES
(1, 1, 'easy', 'mcq', 'What does a graph consist of?', 'a set of edges', 'a set of vertices and a set of edges', 'a set of vertices and one edge', 'a set of vertices and a set of functions', 'b', 1, 'A graph consists of dots in a graph and lines in a graph', 3, '2022-03-28 17:37:14', 2, '0000-00-00 00:00:00', 1),
(2, 1, 'easy', 'mcq', 'Which of the following is a correct set of vertices?', 'V(G) = {v1, v2, v3}', 'V(G) = {v1, v2, ()}', 'V(G) = {(), v2, v3}', 'V(G) = {{}}', 'a', 1, 'Vertex is a dot in a graph', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(4, 1, 'easy', 'mcq', 'Which of the following is an incorrect set of edges?', 'E(G) = {e1, e2, e3, e4}', 'E(G) = {(v1, v2), (v1,v3)}', 'E(G) = {}', 'E(G) = {e1=(v1,v2), e2=(v2,v3)}', 'd', 1, 'The set of edges are the lines and curves in the graph. Each edge can be represented as an ordered pair.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(5, 1, 'easy', 'mcq', 'Which of the following is the correct example of a loop edge?', 'e3 = (a, b)', 'e3 = (a, c)', 'e3 = (a, a)', 'e3 = (a, d)', 'c', 1, 'A loop starts and end at the same vertex.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(6, 1, 'easy', 'mcq', 'Which of the following is the correct example of parallel edges?', 'e1 = (a, b) and e2 = (b, a)', 'e1 = (a, a)', 'e1 = (a, a) and e2 = (b, b)', 'e1 = (a, b) and e2 = (b, c)', 'a', 1, 'Parallel edges start and end at the same two vertices.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(7, 1, 'easy', 'mcq', 'What is the incorrect example of graph implementation?', 'social media', 'computer network', 'schedule assistant', 'transportation system', 'c', 1, 'Graph can be implemented in different applications such as electricity power network, social media network and telephone network.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(8, 1, 'hard', 'mcq', 'What is the name of graph travel that goes from one vertex to another vertex with repeated edges?', 'walk', 'path', 'circuit', 'trivial circuit', 'a', 1, 'There are three types of graph travels, namely: walk, path and circuit.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(9, 1, 'hard', 'mcq', 'What is the name of graph travel that goes from one vertex to another vertex without repeated edges?', 'walk', 'path', 'circuit', 'trivial circuit', 'b', 1, 'There are three types of graph travels, namely: walk, path and circuit.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(10, 1, 'hard', 'mcq', 'What is the name of graph travel that goes from one vertex to another vertex without repeated edges that start and end in the same vertex?', 'walk', 'path', 'circuit', 'trivial circuit', 'c', 1, 'There are three types of graph travels, namely: walk, path and circuit.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(11, 1, 'hard', 'mcq', 'Which of the following is the correct path?', 'A e1 B e2 E e4 B e5 D', 'A e1 B e3 E e4 B e1 A', 'A e1 B e1 A e1 B e5 D', 'A e1 A', 'd', 1, 'There are three types of graph travels, namely: walk, path and circuit.', 3, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(12, 1, 'hard', 'mcq', 'Which of the following is the correct circuit?', 'A e1 B e2 B', 'A e1 B e3 E e4 B', 'A', 'A e1 A e2 B e2 A', 'c', 1, 'There are three types of graph travels, namely: walk, path and circuit.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(15, 2, 'easy', 'mcq', 'What is a tree?', 'A graph that has one vertex and one edge', 'A graph that has circuit and connected', 'A graph that has no circuit and connected', 'Graph that is not circuit free and connected to itself', 'c', 1, 'A tree is a special kind of graph', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(16, 2, 'easy', 'mcq', 'What is a rooted tree?', 'A tree that has one vertex root', 'A tree that has at least two vertex root', 'A rooted tree is a free tree', 'A tree with one vertex root and has circuit to the root', 'a', 1, 'A rooted tree is a special kind of tree that can be visually distingushed from other type of trees', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(17, 2, 'easy', 'mcq', 'A vertex is a sibling to another vertex if:', 'the two vertices has the same root', 'the two vertices has the same edge', 'the two vertices has the same level', 'the two vertices has the same parent', 'd', 1, 'One parent vertex can have several children.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(18, 2, 'easy', 'mcq', 'What is the height of a rooted tree?', 'There is no height for rooted tree.', 'Number of edges from a vertex to the root', 'Number of maximum level of any vertex in a tree', 'Number of minimum edges of any vertex in a tree', 'c', 1, 'The height of a rooted tree can be calculated from its number of levels.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(19, 2, 'easy', 'mcq', 'What is binary tree?', 'A rooted tree that has at least two vertices', 'A tree that has at least two vertices and two edges', 'In a rooted tree, every parent has at least 2 children', 'In a rooted tree, every parent has at most 2 children', 'd', 1, 'Binary Tree is a special kind of rooted tree where each parent would have maximum two vertices', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(20, 2, 'easy', 'mcq', 'Which tree that can be used for natural language processing and text mining?', 'Rooted Tree', 'Binary Tree', 'Parse Tree', 'Trivial Tree', 'c', 1, 'A parse tree shows how grammatically correct sentences (syntax) are derived based on certain rules.\r\nA binary tree is a rooted tree in which every parent has at most 2 children.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(22, 2, 'hard', 'mcq', 'What is the difference between spanning tree and minimum spanning tree?', 'Minimum spanning tree has the least total vertices', 'Minimum spanning tree has only one vertex', 'Minimum spanning tree has the least total edges', 'Minimum spanning tree has the least total weight.', 'd', 1, 'Minimum spanning tree is a special kind of spanning tree for weighted graph.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(24, 2, 'hard', 'mcq', 'A four cities graph has distance between A & B is 5, A & C is 10, B & C is 7, B & D is 8, C & D is 1. Find total weight for the min spanning tree.', '13', '14', '20', '10', 'a', 1, 'A minimum spanning tree is a spanning tree that has the least total weight compared to other spanning trees.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(25, 2, 'hard', 'mcq', 'A four cities graph has distance between A & B is 5, A & C is 10, B & C is 10, B & D is 8, C & D is 1. Find the min spanning tree?', 'A-B-C-D', 'A-B-D-C', 'A-C-B-A', 'D-C--B', 'b', 1, 'A minimum spanning tree is a spanning tree that has the least total weight compared to other spanning trees.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(26, 2, 'hard', 'mcq', 'A five cities graph has distance between  A&B is 3,A&C is 5,B&D is 2,B&E is 3,C&D is 10,C&E is 4,D&E is 2. Find total weight for the min spanning tree', '10', '11', '12', '13', 'b', 1, 'A minimum spanning tree is a spanning tree that has the least total weight compared to other spanning trees.', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(27, 4, 'easy', 'mcq', 'Which of the following is a statement?', 'a = \"1+1=2\"', 'a = \"x+y = 4\"', 'a = \"1+x=4\"', '1+y=4', 'a', 1, 'A statement is a sentence that is known to be either true or false, but not both.\r\n', 0, '2022-03-29 12:14:05', 2, '0000-00-00 00:00:00', 1),
(28, 4, 'easy', 'mcq', 'Which of the following is a correct statement regarding logical operators?', 'The negation of a statement cannot be taken repeatedly', 'p ? q is true only if both p and q are false', 'p V q is true if both p and q are false.', 'p V q is false if both p and q are false.', 'd', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(29, 4, 'easy', 'mcq', 'if p is TRUE and q is TRUE, which of the following is a TRUE statement?', 'p ^ ~q', '~ p ^ q', 'p ^ q', '~ p ^ ~q', 'c', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(30, 4, 'easy', 'mcq', 'if p is TRUE and q is TRUE, which of the following is a FALSE statement?', 'p V ~q', '~ p ^ q', 'p ^ q', 'p V q', 'b', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(31, 4, 'easy', 'mcq', 'if p is TRUE and q is TRUE, which of the following is a FALSE statement?', '~(~p)', '~p', '~(~q)', 'q', 'b', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(32, 4, 'easy', 'mcq', 'if p is TRUE, q is TRUE and r is FALSE, which of the following is a TRUE statement?', 'p ^ q V r', 'p ^ ~ q V r', 'p ^ (~ q V r)', '(p ^ ~ q) V r', 'a', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(33, 4, 'easy', 'mcq', 'if p is TRUE, q is TRUE and r is FALSE, which of the following is a TRUE statement?', '~p V ~q V r', '(~p V q) ^ r', '~(~r)', '~r ^ p ^ q', 'd', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(34, 4, 'easy', 'mcq', 'if p is TRUE, q is TRUE and r is FALSE, which of the following is a TRUE statement?', 'r ^ ~r V r', 'r ^ (~r V r)', '~r ^ (~r V r)', '(~r ^ r) V r', 'c', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(35, 4, 'easy', 'mcq', 'if p is TRUE, q is TRUE and r is FALSE, which of the following is a FALSE statement?', 'p ^ q V ~r', 'p V q V ~r', '~p V ~q V r', 'p V ~q V r', 'c', 1, 'The negation of p means \"not p\" or the oppo of p.\nThe conjunction of p and q means \"p and q\".\nThe disjunction of p and q means \"p or q\".', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(36, 4, 'hard', 'mcq', 'Let a = Jon eats apples, b = Jon eats oranges, c = Jon does not eat grapes. Translate \"Jon eats anything except grapes\" to symbol.', 'a ^ b ^ c', 'a ^ b ^ ~c', 'a V b V c', 'a V b V ~ c', 'a', 1, 'The negation of p means \"not p\" .\r\nThe conjunction of p and q means \"p and q\".\r\nThe disjunction of p and q means \"p or q\".\r\np but q means p and q\r\nneither p nor q means not p and not q', 0, '2022-03-29 12:29:19', 2, '0000-00-00 00:00:00', 1),
(37, 4, 'hard', 'mcq', 'Let a =Jon eats apples, b =Jon eats oranges, c =Jon does not eat grapes. Translate \"Jon eats neither apples nor oranges but he eats grapes\" to symbol.', '~a V ~b V ~c', '~a ^ ~b ^ ~c', 'a V b V c', 'a ^ b ^ c', 'b', 1, 'The negation of p means \"not p\" .\r\nThe conjunction of p and q means \"p and q\".\r\nThe disjunction of p and q means \"p or q\".\r\np but q means p and q\r\nneither p nor q means not p and not q', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
(38, 4, 'hard', 'mcq', 'Let a =Jon eats apples, b =Jon eats oranges, c =Jon does not eat grapes. Translate \"It is not true that Jon likes apples but not oranges\" to symbol.', '~a V ~b', '~ (a ^ b)', '~ (a ^ ~b)', '~a ^ b', 'c', 1, 'The negation of p means \"not p\" .\r\nThe conjunction of p and q means \"p and q\".\r\nThe disjunction of p and q means \"p or q\".\r\np but q means p and q\r\nneither p nor q means not p and not q', 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', 1),
